import React from "react";

const Loading = () => {
  return (
    <div className="flex justify-center items-center relative w-full h-full">
      <i
        className="pi pi-car"
        style={{ fontSize: "2.25rem", zIndex: 10, position: "absolute" }}
      ></i>

      <div className="w-[25%] h-[25%] border-1 border-gray-200 rounded-full animate-spin border-t-blue-500"></div>
    </div>
  );
};

export default Loading;
